import ReactDOM, { render } from 'react-dom';
import Button from '@material-ui/core/Button';
import Header from '../Components/Header';

class Index extends Component{
    render(){
        return(
            <div>
                <h1>Hello Shubham</h1>
                <Header />
            </div>
        );
    }
}

export default Index;
